  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Morada de Piatã - Consulta de Vaga de Garagem</title>
  <link rel="stylesheet" href="style.css">
  <link rel="icon" type="image/png" href="img/favicon.png">
</head>
<body>

<header class="topbar">
  <div class="topbar-content">
    <img src="img/moradadepiata.png" alt="Condomínio Morada de Piatã" class="logo">
    <div class="topbar-text">
      <h1>Morada de Piatã</h1>
      <span>Consulta de Vaga de Garagem</span>
    </div>
  </div>
  <div class="topbar-line"></div>
</header>

<main class="container">
  <section class="card">
    <h2>Informe os dados abaixo</h2>

    <form id="consultaForm" class="form-grid">
      <div class="field">
        <label for="torre">Torre</label>
        <select id="torre">
          <option value="">Selecione</option>
          <option value="1">Torre 1</option>
          <option value="2">Torre 2</option>
          <option value="3">Torre 3</option>
          <option value="4">Torre 4</option>
          <option value="5">Torre 5</option>
        </select>
      </div>

      <div class="field">
        <label for="apto">Apartamento</label>
        <select id="apto" disabled>
          <option value="">Selecione</option>
        </select>
      </div>

      <div class="actions">
        <button type="submit">Consultar</button>
      </div>
    </form>

    <div id="resultado" class="resultado"></div>
  </section>

  <section class="card" id="cardLocalizacao" style="display: none;">
